// assets
import { IconKey, IconPlaylist } from '@tabler/icons-react';

// constant
const icons = {
  IconKey, IconPlaylist
};

// ==============================|| EXTRA PAGES MENU ITEMS ||============================== //

const pages = {
  id: 'pages',
  title: 'Pages',
  caption: 'Pages Caption',
  type: 'group',
  children: [
    {
      id: 'authentication',
      title: 'Authentication',
      type: 'collapse',
      icon: icons.IconKey,

      children: [
        {
          id: 'login3',
          title: 'Login',
          type: 'item',
          url: '/pages/login/login3',
          target: true
        },
        {
          id: 'register3',
          title: 'Register',
          type: 'item',
          url: '/pages/register/register3',
          target: true
        }
      ]
    },
    {
      id: 'playlists',
      title: 'Playlists',
      type: 'collapse',
      icon: icons.IconPlaylist,

      children:[
        {
          id: 'playlist1',
          title: 'Playlist 1',
          type: 'item',
          url: '/pages/playlist/playlist',
          target: true
        },
        {
          id: 'playlist2',
          title: 'Playlist 2',
          type: 'item',
          url: '/pages/playlist/playlist',
          target: true
        }
      ]
    }
  ]
};

export default pages;
